import React, { Component } from "react";
import ProjectItem from "./project/ProjectItem";
import Header from "./Layout/Header";

class Dashboard extends Component {
  render() {
    return (
      <div>
        <h1>Welcome to the Dashboard</h1>
        <Header />
        <ProjectItem />
      </div>
    );
  }
}

export default Dashboard;
